import logo from './logo.svg';
import './App.css';
import React, { useEffect, useState } from "react";
import USAMap from "react-usa-map";
import statesJson from "./states.json";

import Button from "@mui/material/Button";


function App() {
  const [hoveredState, setHoveredState] = useState(null);
  const [text, setText] = useState('insert state')
  const handleStateHover = (event) => {
    setHoveredState(event.target.dataset.abbreviation);
  };

  const handleStateLeave = () => {
    setHoveredState(null);
  };

  const handleClick = (e) => {;
    setText(e.target.dataset.name);
  }
  
  return (
    <>
    <div id="website"  className="container-center-horizontal">
      <h1 id="title">Meal Mapper {text}</h1>
    </div>
      <USAMap
        onMouseOver={handleStateHover}
        onMouseLeave={handleStateLeave}
        onClick={handleClick}
      />
    </>
  );
}

export default App;
